import React, { useState, useEffect } from 'react';

function StockAnalysisPage() {
  const [sections, setSections] = useState([]);

  useEffect(() => {
    fetch('/TechnicalAnalysis.txt') // Update the path to your text file
      .then(response => response.text())
      .then(text => {
        const sectionsArray = text.split('## ');
        const filteredSections = sectionsArray.filter(section => section.trim() !== '');

        setSections(filteredSections.map(section => {
          const [heading, ...contentLines] = section.split('\n');
          const content = contentLines.join('\n'); // Use '\n' for line breaks
          return { heading, content };
        }));
      })
      .catch(error => console.error('Error fetching the text file:', error));
  }, []);

  return (
    <div>
      <h1>Technical Analysis of Stock Data</h1>
      {sections.map((section, index) => (
        <div key={index}>
          <h2>{section.heading}</h2>
          <p>{section.content}</p>
        </div>
      ))}
      <img
        src="https://example.com/your-image.jpg"
        alt="Description of your image"
      />
      <div className="video-container">
        <iframe
          width="560"
          height="315"
          src="https://www.youtube.com/embed/ZCFkWDdmXG8"
          title="Embedded YouTube video"
          frameBorder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowFullScreen
        ></iframe>
      </div>
    </div>
  );
}

function TechnicalAnalysis() {
  const [fileContent, setFileContent] = useState('');

  const handleFileInputChange = (event) => {
    const file = event.target.files[0];
    const reader = new FileReader();

    reader.onload = (e) => {
      const content = e.target.result;
      setFileContent(content);
    };

    reader.readAsText(file);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Stock Analysis</h1>
      </header>
      <main>
        <input type="file" onChange={handleFileInputChange} />
        <div>
          <h2>File Content:</h2>
          <pre>{fileContent}</pre>
        </div>
        <StockAnalysisPage />
      </main>
      <footer>
        <p>Â© 2024 Stock Analysis App</p>
      </footer>
    </div>
  );
}

export default TechnicalAnalysis;
